Halteu Pondok Rajeg (kodeu: PDRG) nyaéta halteu karéta api non-aktip anu perenahna di Pondok Rajeg, Cibinong, Bogor. Sanajan jalur karéta api Citayam-Nambo geus dilayanan KRL Commuter Line, halteu ieu henteu dilayanan ku KRL. Wangunan halteu ieu geus ruksak sarta jadi korban vandalisme.
